import logo from "./logo.svg";
import "./App.css";
let name = "Black_Wolf";
function App() {
  return (
    <>
      <nav>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
        <li>Service</li>
      </nav>
      <img src="" alt="" />
      <div className="container">
        <h1>Hello {name}</h1>
        <p>
          Lorem ipsum dolor sit, amet consectetur adipisicing elit. Perferendis
          vitae, officiis animi placeat architecto similique. Numquam minima
          veniam facere molestiae expedita quia ea suscipit earum! Ea odit
          explicabo dolorum aliquam.
        </p>
      </div>
    </>
  );
}

export default App;
